import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and locate the first video container with data-video-id='1'
    await page.waitForSelector('div.video-container[data-video-id="1"]');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_video_found.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_video_found.png'));

    // Click the like button inside the first video container
    const likeButton = await page.$('div.video-container[data-video-id="1"] button.like-btn');
    await likeButton.click();

    // Wait for potential UI updates after clicking like
    await page.waitForTimeout(1000);

    // Take screenshot after clicking like
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_liked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_liked.png'));

    // Verify the like action was successful by checking button state
    const buttonClass = await likeButton.evaluate(el => el.className);
    const isLiked = buttonClass.includes('liked') || buttonClass.includes('active');

    return {
      success: true,
      action: "Clicked like button on first video (data-video-id='1')",
      extractedData: {
        videoId: '1',
        buttonClass: buttonClass,
        isLiked: isLiked
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

