import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first video container with data-video-id='1'
    await page.waitForSelector('div[data-video-id="1"]', { timeout: 5000 });

    // Use XPath to locate the like button within the first video container
    const likeButton = await page.waitForSelector('xpath=//div[@data-video-id="1"]//button[contains(@class, "like-btn")]', { timeout: 3000 });

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    // Click the like button
    await likeButton.click();

    // Wait for potential state change (if any animation/update occurs)
    await page.waitForTimeout(1000);

    // Take screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_click.png'));

    // Extract button state to verify action
    const buttonState = await page.$eval('xpath=//div[@data-video-id="1"]//button[contains(@class, "like-btn")]', 
      (btn) => ({
        classList: btn.className,
        textContent: btn.textContent.trim()
      })
    );

    return {
      success: true,
      action: "Clicked like button on first video (data-video-id='1')",
      extractedData: {
        buttonState: buttonState,
        videoId: 1
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
